------------------------------------------ CREACI√ìN DE TABLAS -------------------------------------------------------------


CREATE table Paises(
	ID integer primary key not null,
	Nombre varchar(64)
);

CREATE table Ciudades(
	ID integer primary key not null,
	Nombre varchar(64),
	ID_pais integer,
	CONSTRAINT FK_Paises FOREIGN KEY (ID_pais)
    REFERENCES Paises(ID)
);

Create table Companias(
	ID integer primary key not null,
	Nombre varchar(64),
	Direccion varchar(64)
);

-- Tabla de Clientes
create Table Clientes(
    ID integer primary key not null,
    Nombre varchar(64) not null,
    Lenguaje varchar(64) not null,
    Foto varchar(64) not null,
    Celular integer not null,
    Email1 varchar(64) not null,
    Email2 varchar(64) not null,
    Codigo_invitacion varchar(8) not null,
    Indicador_recibos numeric(1) not null,
	ID_pais integer,
	ID_Compania integer,
	CONSTRAINT FK_Pais_del_cliente FOREIGN KEY (ID_pais)
    REFERENCES Paises(ID),	
	CONSTRAINT FK_Compania_del_cliente FOREIGN KEY (ID_Compania)
    REFERENCES Companias(ID)
);


Create table Medios_de_pago(
	ID integer primary key not null,
	Nombre varchar(64),
	Detalle varchar(128),
	ID_cliente integer, 
	ID_Compania integer, 
	CONSTRAINT FK_Mpago_del_Clientes FOREIGN KEY (ID_cliente)
    REFERENCES Clientes(ID),
	CONSTRAINT FK_Mpago_de_compania FOREIGN KEY (ID_Compania)
    REFERENCES Companias(ID)
);


CREATE table Codigos_promocion(
	ID integer primary key not null,
	Codigo varchar(8),
	ID_cliente integer,
	CONSTRAINT FK_Codigo_del_Cliente FOREIGN KEY (ID_cliente)
    REFERENCES Clientes(ID)
);

Create table Servicios(
    ID integer primary key not null,
    Nombre varchar(64)
);

Create table Vehiculos(
    ID integer primary key not null,
    ID_servicio integer,
    Placa varchar(6),
    Modelo integer,
    Marca varchar(64),
    Ano integer,
    CONSTRAINT FK_Servicio_del_vehiculo FOREIGN KEY (ID_servicio)
    REFERENCES Servicios(ID)
);

-- Tabla de Conductores
create Table Conductores(
    ID integer primary key not null,
    Nombre varchar(64) not null,
    Lenguaje varchar(64) not null,
    Foto varchar(128) not null,
    Celular integer not null,
    Email1 varchar(64) not null,
    Email2 varchar(64) not null,
    Codigo_invitacion varchar(8) not null,
    Indicador_recibos integer not null,
	ID_pais integer,
    Cuenta_pago varchar(64),
	CONSTRAINT FK_Pais_del_condu FOREIGN KEY (ID_pais)
    REFERENCES Paises(ID)	
);

Create table Conductores_y_vehiculos(
	ID_conductor not null,
	ID_vehiculo not null,
	PRIMARY key(ID_conductor,ID_vehiculo),
	CONSTRAINT FK_Condcutor_del_vehiculo FOREIGN KEY (ID_conductor)
    REFERENCES Conductores(ID),
	CONSTRAINT FK_Vehiculos_del_conductor FOREIGN KEY (ID_vehiculo)
    REFERENCES Vehiculos(ID)
);


Create table Viajes(
	ID integer primary key not null,
	Fecha date not null,
	Distancia FLOAT(5) not null,
	Tiempo_recorrido date not null,
	Total FLOAT(5) not null,
	Subtotal FLOAT(5) not null,
	Hora_salida date not null,
	Hora_llegada date not null,
	Origen varchar(64) not null,
	Destino varchar(64) not null,
	ID_conductor integer,
	ID_servicio integer,
	ID_medioPago integer,
	ID_ciudad integer,
	CONSTRAINT FK_Condcutor_del_viaje FOREIGN KEY (ID_conductor)
    REFERENCES Conductores(ID),
	CONSTRAINT FK_Servicio_del_viaje FOREIGN KEY (ID_servicio)
    REFERENCES Servicios(ID),
	CONSTRAINT FK_Mediopago_del_viaje FOREIGN KEY (ID_medioPago)
    REFERENCES Medios_de_pago(ID),
	CONSTRAINT FK_Ciudad_del_viaje FOREIGN KEY (ID_ciudad)
    REFERENCES Ciudades(ID)
);

Create table Liquidacion(
	ID integer primary key not null,
	Fecha date not null,
	ID_conductor integer,
    Total Float(5) not null,
	CONSTRAINT FK_Condcutorliquidado FOREIGN KEY (ID_conductor)
    REFERENCES Conductores(ID)
);

